import React from "react";
import { NavLink } from "react-router-dom";

const Header = () => {
  return (
    <header>
      <nav id="navigation">
        <div id="logoNav">
        </div>
        <div id="websiteName">
          <h1><NavLink to={'/'}>Viddev</NavLink></h1>
        </div>
        <div id="linksNav">
            <ul>
                <li><NavLink to={'/tvshows'}>Tv Shows</NavLink></li>
                <li><NavLink to={'/movies'}>Movies</NavLink></li>
                <li><NavLink to={'/recentlyadd'}>Recently Added</NavLink></li>
                <li><NavLink to={'/favorites'}>My List</NavLink></li>
                <li><NavLink to={'/login'}>Login</NavLink></li>
                <li><NavLink to={'/register'}>Registrer</NavLink></li>
            </ul>
        </div>
      </nav>
      <section>
      </section>
    </header>
  );
};

export default Header;
